import { db } from "../firebaseConfig";
import "firebase/firestore";
import React from "react";

function test() {
    return (
        <div>
            {db
                .collection("products")
                .get()
                .then((res) => {
                    res.forEach((doc) => {
                        console.log(doc.data());
                    });
                })}
        </div>
    );
}

export default test;
